  false,\n\t\"url\": null,\n\t\"notes\": \"The AVHRR Pathfinder Version 5.2 Sea Surface
  Temperature datan                    set (PFV52) is a collection of global, twice-daily
  4km sea surface temperaturen                    data produced in a partnership by
  the NOAA National Oceanographic Data Centern                    and the University
  of Miami's Rosenstiel School of Marine and Atmosphericn                    Science.
  PFV52 was computed from data from the AVHRR instruments on board NOAA'sn                    polar
  orbiting satellite series using an entirely modernized system based onn                    SeaDAS.
  This system incorporates several key changes from Versions 5.0 and 5.1n                    of
  Pathfinder, including the use of an entirely new land mask, a modified grid,n                    and
  the inclusion of sea ice, wind speed, and aerosol ancillary data to supportn                    the
  use of the SST data. Importantly, PFV52 data are provided in netCDF-4n                    (classic
  model, with internal compression and chunking) and are nearly 100%n                    compliant
  with the GHRSST Data Specification Version 2.0 for L3C products. Thesen                    data
  deviate from that standard only in that sses_bias, sses_standard_deviation,n                    and
  sst_dtime variables are empty. PFV52 data were collected through then                    operational
  periods of the NOAA-7 through NOAA-18 Polar Operationaln                    Environmental
  Satellites (POES), and are available for 1981 through 2012. Datan                    for
  all years are available as separate NODC accessions.\",\n\t\"license_title\": null,\n\t\"extras\":
